import React from 'react';
import LeftCard from './Leftcard';
import RightCard from './Rightcard';

function Card() {
    const style = {
        width : "17rem"
    }
    return (
    <React.Fragment>
        <h1 className="news">BBC-NEWS</h1>
        <div class="row">
            <LeftCard/>
            <RightCard/>
        </div>
    </React.Fragment>
    )
}

export default Card;
